    return(

        <>
            <section className="student">
                <div className="container py-5">
                    <div className="row">
                        <div className="col">
                            <div className="heading">
                                <h2>Our developers</h2>
                                <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Deleniti, totam?consectetur adipisicing elit. Deleniti, totam?consectetur adipisicing elit. Deleniti, totam?</p>
